
CREATE DATABASE QLyThuVien 
GO
USE QLyThuVien
GO
--Tao cac bang

CREATE TABLE SACH
(
	MaSach		CHAR(10) PRIMARY KEY,
	TenSach		NVARCHAR(200) NOT NULL,
	TheLoai		NVARCHAR(100) NOT NULL,
	TinhTrang	NVARCHAR(20),
	SoLuong		INT NOT NULL,
	NXB			NVARCHAR(200)NOT NULL,
	NamXB		NVARCHAR(20) NOT NULL,
	TG			NVARCHAR(200) NOT NULL,
	Hinh		IMAGE
)
GO
CREATE TABLE NHANVIEN
(
	MaNV		CHAR(10) PRIMARY KEY,
	TenNV		NVARCHAR(100) NOT NULL,
	NgaySinh    DATETIME NOT NULL,
	NgayVaoLam  DATETIME NOT NULL,
	Gioitinh	Bit NOT NULL,
	ChucVu  	NVARCHAR(50) NOT NULL,
	DiaChi  	NVARCHAR(200) NOT NULL,
    Sdt     	NVARCHAR(20)
)
select * from NHANVIEN
GO
CREATE TABLE THETHUVIEN
(
	MaThe		CHAR(10) PRIMARY KEY,
	TenSV		NVARCHAR(100) NOT NULL,
	Gioitinh	Bit NOT NULL,
	NgaySinh	DATETIME,
	QueQuan	 	NVARCHAR(200) NOT NULL,
	SdtSV   	NVARCHAR(20),
	NgayTao		DATETIME NOT NULL,
	NgayHetHan	DATETIME NOT NULL,
)

GO
CREATE TABLE PHIEUMUON
(
	MaPM		CHAR(10) PRIMARY KEY,
	MaSach		CHAR(10) NOT NULL,
	MaThe		CHAR(10) NOT NULL,
	NgayMuon	DATETIME NOT NULL,
	NgayTra     DATETIME NOT NULL,
)
GO
CREATE TABLE SACHMUON
(
	MaPM		CHAR(10),
	MaSach		CHAR(10),
	TinhTrang	NVARCHAR(20),
	SLSachMuon	INT NOT NULL,
	PRIMARY KEY (MaPM,MaSach)
)
select * from SACHMUON
