CREATE PROC sp_LOADTHETHUVIEN
AS
	BEGIN
		SELECT MaThe,TenSV,CASE WHEN Gioitinh=1 THEN 'Nam' ELSE N'Nữ' END AS Gioitinh,NgaySinh,QueQuan,SdtSV,NgayTao,NgayHetHan FROM THETHUVIEN
	END
GO
CREATE PROC sp_SUATHETHUVIEN
	@MaThe		CHAR(10),
	@TenSV		NVARCHAR(100),
	@Gioitinh	Bit,
	@NgaySinh   DATETIME,
	@QueQuan	NVARCHAR(200),
	@DienThoai  NVARCHAR(20),
	@NgayTao	DATETIME ,
	@NgayHetHan	DATETIME 
AS
	BEGIN
		IF NOT EXISTS(SELECT * FROM THETHUVIEN WHERE MaThe=@MaThe)
			RETURN 1---KO TON TAI THETHUVIEN
		UPDATE THETHUVIEN
		SET TenSV=@TenSV,Gioitinh=@Gioitinh,NgaySinh=@NgaySinh,QueQuan=@QueQuan,SdtSV=@DienThoai,NgayTao=@NgayTao,NgayHetHan=@NgayHetHan
		WHERE MaThe=@MaThe
	END
GO
CREATE PROC sp_LUUTHETHUVIEN
	@MaThe		CHAR(10),
	@TenSV		NVARCHAR(100),
	@Gioitinh	Bit,
	@NgaySinh   DATETIME,
	@QueQuan	NVARCHAR(200),
	@DienThoai	NVARCHAR(20),
	@NgayTao	DATETIME ,
	@NgayHetHan	DATETIME 
AS
	BEGIN
		IF  EXISTS(SELECT * FROM THETHUVIEN WHERE MaThe=@MaThe)
			RETURN 1
		INSERT INTO THETHUVIEN VALUES (@MaThe,@TenSV,@Gioitinh,@NgaySinh,@QueQuan,@DienThoai,@NgayTao,@NgayHetHan)
	END
GO
CREATE PROC sp_XOATHETHUVIEN
@MATHE CHAR(10)
AS
	BEGIN
		IF EXISTS(SELECT * FROM PHIEUMUON WHERE MaThe=@MATHE)
			RETURN 1---TON TAI the
		IF EXISTS(SELECT * FROM PHIEUNHACTRA WHERE MaThe=@MATHE)
			RETURN 1---TON TAI the
		DELETE FROM THETHUVIEN
		WHERE @MATHE=MaThe
	END
GO
-----------------truy vấn dữ liệu NHANVIEN
CREATE PROC sp_LOADNHANVIEN
AS
	BEGIN
		SELECT MaNV,TenNV,CONVERT(CHAR(10),NgaySinh,103) as NgaySinh,CONVERT(CHAR(10),NgayVaoLam,103) as NgayVaoLam,CASE WHEN Gioitinh=1 THEN 'Nam' ELSE N'NỮ' END AS Gioitinh,ChucVu,DiaChi,Sdt FROM NHANVIEN
	END
GO
CREATE PROC sp_SUANHANVIEN
	@MaNV		CHAR(10),
	@TenNV		NVARCHAR(100),
	@NgaySinh	DATETIME,
	@NgayVL		DATETIME,
	@Gioitinh	Bit,
	@ChucVu 	NVARCHAR(50),
	@DiaChi 	NVARCHAR(200),
	@DienThoai	NVARCHAR(20) 
AS
	BEGIN
		IF NOT EXISTS(SELECT * FROM NHANVIEN WHERE MaNV=@MaNV)
			RETURN 1----KO TON TAI MANV
		UPDATE NHANVIEN
		SET TenNV=@TenNV,NgaySinh=@NgaySinh,NgayVaoLam=@NgayVL,Gioitinh=@Gioitinh,ChucVu=@ChucVu,DiaChi=@DiaChi,Sdt=@DienThoai
		WHERE MaNV=@MaNV
	END
GO
CREATE PROC sp_LUUNHANVIEN
	@MaNV		CHAR(10),
	@TenNV		NVARCHAR(100),
	@NgaySinh	DATETIME,
	@NgayVL		DATETIME,
	@Gioitinh	Bit,
	@ChucVu 	NVARCHAR(50),
	@DiaChi 	NVARCHAR(200),
	@DienThoai	NVARCHAR(20)  
AS
	BEGIN
		IF EXISTS(SELECT * FROM NHANVIEN WHERE MaNV=@MaNV)
			RETURN 1----TON TAI MANV
		INSERT INTO NHANVIEN VALUES (@MaNV,@TenNV,@NgaySinh,@NgayVL,@Gioitinh,@ChucVu,@DiaChi,@DienThoai)
	END
GO
CREATE PROC sp_XOANHANVIEN
@MANV CHAR(10)
AS
	BEGIN
		IF EXISTS(SELECT * FROM PHIEUNHACTRA WHERE MaNV=@MaNV)
			RETURN 1----TON TAI MANV
		DELETE FROM NHANVIEN
		WHERE @MANV=MaNV
	END
GO
-----------------truy vấn dữ liệu PHIEUMUON
CREATE PROC sp_LOADPHIEUMUON
AS
	BEGIN
		SELECT MaPM,MaSach,MaThe,CONVERT(CHAR(10),NgayMuon,103) as NgayMuon, CONVERT(CHAR(10),NgayTra,103) as NgayTra FROM PHIEUMUON
	END
GO
CREATE PROC sp_SUAPHIEUMUON
	@MaPM		CHAR(10),
	@MaSach		CHAR(10),
	@MaThe		CHAR(10),
	@NgayMuon	DATETIME,
	@NgayTra    DATETIME
AS
	BEGIN
		IF NOT EXISTS(SELECT * FROM PHIEUMUON WHERE MaPM=@MaPM)
			RETURN 1----KO TON TAI mapm
		IF NOT EXISTS(SELECT * FROM SACH WHERE MaSach=@MaSach)
			RETURN 2----KO TON TAI masach
		IF NOT EXISTS(SELECT * FROM THETHUVIEN WHERE MaThe=@MaThe)
			RETURN 3----KO TON TAI mathe
		UPDATE PHIEUMUON
		SET MaSach=@MaSach,MaThe=@MaThe,NgayMuon=@NgayMuon, NgayTra=@NgayTra
		WHERE MaPM=@MaPM
	END
GO
CREATE PROC sp_LUUPHIEUMUON
	@MaPM		CHAR(10),
	@MaSach		CHAR(10),
	@MaThe		CHAR(10),
	@NgayMuon	DATETIME,
	@NgayTra    DATETIME
AS
	BEGIN	
		IF EXISTS(SELECT * FROM PHIEUMUON WHERE MaPM=@MaPM)
			RETURN 1----TON TAI mapm
		IF NOT EXISTS(SELECT * FROM SACH WHERE MaSach=@MaSach)
			RETURN 2----KO TON TAI masach
		IF NOT EXISTS(SELECT * FROM THETHUVIEN WHERE MaThe=@MaThe)
			RETURN 3----KO TON TAI mathe
		INSERT INTO PHIEUMUON VALUES (@MaPM,@MaSach,@MaThe,@NgayMuon,@NgayTra)
	END
GO
CREATE PROC sp_XOAPHIEUMUON
@MAPM CHAR(10)
AS
	BEGIN
		IF EXISTS(SELECT * FROM SACHMUON WHERE MaPM=@MaPM)
			RETURN 1----TON TAI mapm trong sachmuon
		DELETE FROM PHIEUMUON
		WHERE @MAPM=MaPM
	END
GO
